import React from 'react';
import logo from '../assets/djezzy.png';

function HomeNav() {
    return (
        <div className="text-black flex justify-between items-end h-24 max-w-[1900px] mx-auto px-4 border-b border-black mb-4">
            <img
                className="object-scale-down h-30 w-20 pt-3"
                src={logo}
                alt="djezy logo"
            />
            <ul className="flex pr-10 font-bold text-lg">
                <li className="p-4">
                    <a href="#" className="nav-link hover:border-b hover:border-black">
                        Accueil
                    </a>
                </li>
                <li className="p-4">
                    <a href="#" className="nav-link hover:border-b hover:border-black">
                        Contact
                    </a>
                </li>
            </ul>
        </div>
    );
}

export default HomeNav;
